/**
 * Decode a felt252 to a 5-letter word.
 * Packing: felt = b0*256^4 + b1*256^3 + b2*256^2 + b3*256 + b4
 */
export function getWord(index: number): string {
  if (index < 0 || index >= WORD_FELTS.length) {
    throw new RangeError(`Word index ${index} out of range [0, ${WORD_FELTS.length})`);
  }
  let packed = WORD_FELTS[index];
  const chars: string[] = new Array(5);
  for (let i = 4; i >= 0; i--) {
    chars[i] = String.fromCharCode(Number(packed & 0xFFn));
    packed >>= 8n;
  }
  return chars.join("");
}

/** All 2315 words decoded as strings. */
export const WORDS: string[] = WORD_FELTS.map((_, i) => getWord(i));

/** Pick a random word and its index. */
export function getRandomWord(): { word: string; index: number } {
  const index = Math.floor(Math.random() * WORD_COUNT);
  return { word: WORDS[index], index };
}
